import React from 'react';
import "./Tri.css";

const tri =props => (


    <div>
        
            <div className="d-flex justify-content-center">
                
                <img src={require(`./images/bg.png`)} className="triselecter"/>
            </div>
            <div>
                <img src={require(`./images/bg.png`)} className="tritop"/>
                <img src={require(`./images/bg.png`)} className="tribot"/>
                <img src={require(`./images/bg.png`)} className="triright"/>
                <img src={require(`./images/bg.png`)} className="trileft"/>
            </div>

    </div>

);

export default tri;
